import React from 'react';
import MyImage from './spoti.png';
import './SpotifyPlaylistButtons.css'

const SpotifyPlaylistButtons = ({ playlists }) => {
  return (
    <div className="row">
      <div className="col-8">
        {playlists.map((playlist, index) => (
          <a key={index} href={playlist.link} target="_blank" rel="noopener noreferrer">
            <button
              style={{
                backgroundColor: '#1DB954',
                color: '#FFFFFF',
                padding: '10px 20px',
                fontSize: '16px',
                borderRadius: '5px',
                border: 'none',
                margin: '5px',
                cursor: 'pointer',
              }}
            >
              {playlist.name}
            </button>
          </a>
        ))}
      </div>
      <div className="col-4">
        <img src={MyImage} alt="Internet Image" />
      </div>
    </div>
  );
};

export default SpotifyPlaylistButtons;
